import Header from "./components/Header";
import React, { Fragment } from "react";
import todolist from "./components/ToDoList";

function App() {
  const todo = <ToDoList />;
  return (
    <Fragment>
      <Header/>
      {todo}
    </Fragment>
  );
}

export default App;
